import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Contact from "./components/Contact";
import "./app.css";
import Home from "./components/Home";

function App() {
  return (
    <Router>
    <Switch>
      <Route path='/' component={Home} />
      <Route path='/form' component={Contact} />
    </Switch>
    </Router>
  );
}

export default App;
